import React from 'react'
import {Login, Background} from '../../component/index.js'
import './Welcome.scss'


class Welcome extends React.Component{
    render(){
        return(
            <div className='page'>
                <Background />
            
                <header>
                    <span>Be</span>
                    <a><img/></a>
                    <span>Up</span>
                </header>

                <section className='join'>

                    <div className='join__form'>
                        <Login />
                    </div>

                </section>

            </div>
        )
    }
}

export default Welcome;
